import React from 'react';

function Chat() {
  return (
    <div className="ai-container" style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', textAlign: 'center' ,color: 'white'}}>
      <>
        AI-powered chat feature is under development.  
